import React, {useEffect} from 'react'
import BrandLogo from '../Svgs/BrandLogo/BrandLogo'
// import {introAnim} from '../../utils/common/topLayerAnim'
// import * as action from '../../store/actions/index'
// import {connect} from 'react-redux'
// import './TopLayover.css'

function TopLayover(props) {

  useEffect(()=>{
    // introAnim(props.hasSession)
    // if(!props.hasSession){
    //   setTimeout(()=>{
    //   props.setSession(true)
    //   }, 9500)
    // }
  })
  
  return (
    <div className="top-layover">
      <div className="top-layover-container content-center">
        <div className="top-layover-logo content-center">
          <BrandLogo 
            colorMode={'#E3E1C3'}/>
          {props.hasSession ? null : 
          <p className='top-loading'
            style={{'color': '#F0EED2'}}>
              We are loading . . .</p> }
        </div>
      </div>
      <div className="top-layover-runner">
        <span className='top-runner' 
          style={{'background':'#CCCAAE'}}></span>
      </div>
      <style jsx>{`
      .top-layover {
        width: 100%;
        height: 100vh;
        position: fixed;
        z-index: 1000;
      }

      .top-layover-container, .top-layover-runner{
        position: absolute;
        width: 100%;
        height: 100vh;
      }

      .top-layover-container {
        z-index: 950;
      }

      .top-layover-logo {
        width: 160px;
        height: 180px;
      }

      .top-layover-logo svg {
        opacity: 0;
        width: 160px
      }

      .top-loading {
        font-family: 'Poppins', Helvetica, Verdana;
        font-size: 1em;
        font-weight: 600;
        letter-spacing: -0.05em;
        color: #B1B099;
        height: 40px;
        opacity: 0;
        width: 100%;
        line-height: 40px;
        text-align: center;
      }

      .top-layover-runner {
        z-index: 900;
      }

      .top-runner {
        position: relative;
        display: block;
        width: 100%;
        height: 100vh;
      }

      @media (max-width: 568px){
        .top-layover-logo {
          width: 150px;
          height: 169px;
        }
        .top-layover-logo svg {
          width: 150px
        }
        .top-loading {
          font-size: 0.98em;
        }
      }

      @media (max-width: 468px) {
        .top-layover-logo {
          width: 140px;
          height: 158px;
        }
        .top-layover-logo svg {
          width: 140px
        }
        .top-loading {
          font-size: 0.95em;
        }
      }

      @media (max-width: 368px) {
        .top-layover-logo {
          width: 130px;
          height: 147px;
        }

        .top-layover-logo svg {
          width: 130px
        }

        .top-loading {
          font-size: 0.9em;
        }
      } 
      `}</style>
    </div> 
  )
}

// const mapStateToProps = (state) => {
//   return {
//     state: state.state,
//     hasSession: state.state.hasSession,
//     colorModes: state.state.colorModes,
//     topOverLayIsRunning: state.state.topOverLayIsRunning
//   }
// }

// const mapDispatchToProps = (dispatch, ownProps) => {
//   return {
//     setSession: (val) => { dispatch(action.checkBrowserSession(val)) }
//   }
// }

// export default connect(mapStateToProps, mapDispatchToProps)(TopLayover)
export default TopLayover
